import React from 'react';
import { Router } from '@reach/router';

import Octicon, { Beaker } from '@primer/octicons-react';
import { Navbar, Button, Alignment, Classes, Colors } from '@blueprintjs/core';

import cn from 'classnames';

const DiagonalSeperator = ({ reversed, height, width, color = Colors.BLACK,
    ...props
}) => (
    <div className={cn('separator', { reversed })} {...props}>
        <style jsx>{`
            .separator {
                width: 0;
                height: 0;
                border-style: solid;
                border-width: ${height}vh ${width}vw 0 0;
                border-color: ${color} transparent transparent transparent;
            }

            .reversed.separator {
                border-width: ${height}vh 0 0 ${width}vw;
            }
        `}</style>
    </div>
);

const Container = ({ children, ...props }) => (
    <div className='container' {...props}>
        {children}
        
        <style jsx>{`
            .container {
                width: 100%;
                margin: 0 auto;
                max-width: 850px;
            }
        `}</style>
    </div>
);

const Home = () => (<>
    <div style={{ backgroundColor: Colors.BLACK }}
        className={Classes.DARK}
    >
        <Navbar style={{ backgroundColor: Colors.BLACK }}>
            <Container>
                <Navbar.Group align={Alignment.LEFT}>
                    <Navbar.Heading>votsec</Navbar.Heading>
                </Navbar.Group>

                <Navbar.Group align={Alignment.RIGHT}>
                    <Button minimal icon={<Octicon icon={Beaker} />} />
                </Navbar.Group>
            </Container>
        </Navbar>

        <Container>
            <h1 className='hero-header'>
                Vote your <span className='hero-highlight'>mind</span>
            </h1>
        </Container>

        <style jsx>{`
            .hero-header {
                font-size: 7em;
                text-align: center;
            }

            .hero-higlight {
                color: ${Colors.VIOLET1};
            }
        `}</style>
    </div>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
